import Card from 'react-bootstrap/Card';

export default function FanFavorite () {
    return (
        <div>
            <h1>Fan favorites</h1>
            <Card>
                <Card.Img />
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                </Card.Body>
            </Card>
        </div>
    )
}
